tables.table_schema:
CREATE TABLE interactive_dashboards (
    dashboard_id INT PRIMARY KEY,
    dashboard_name VARCHAR(50) NOT NULL,
    created_date TIMESTAMP NOT NULL
);

CREATE TABLE data_visualization (
    visualization_id INT PRIMARY KEY,
    visualization_type VARCHAR(50) NOT NULL,
    data_source VARCHAR(100) NOT NULL,
    visualization_query TEXT
);

CREATE TABLE data_visualization (
    dashboard_id INT PRIMARY KEY,
    dashboard_name TEXT,
    creator_name TEXT,
    creation_date DATE
);

CREATE TABLE dashboard_logs (
    log_id SERIAL PRIMARY KEY,
    log_timestamp TIMESTAMP,
    log_message TEXT,
    dashboard_id INT REFERENCES data_visualization(dashboard_id)
);
